$(document).ready(()=>{$("a").each((e,t)=>{$(t).attr('href')!==undefined&&!$(t).attr("href").match(/\.\/.+|\.\.\/.+/)&&new URLParse($(t).attr("href")).getHost()!==new URLParse().getHost()&&$(t).on("click",e=>{e.preventDefault();let t=$("#redirectWarn");$(t).find(".url-location").text($(e.target).attr("href")),$(t).modal("show"),$(t).find(".redirectContinue").on("click",()=>{window.open($(e.target).attr("href"),"_self"),$(t).modal("hide")})})})});